INSERT INTO `products` (`product_id`, `product_name`, `desciption`, `default_price`, `default_stock_quantity`, `image`, `brand_id`, `category_id`, `gender`, `created_at`, `updated_at`) VALUES
('005c13f1-5d88-48a2-b5df-7c632139cf5d', 'LeBron XXI \"Conchiolin\"', 'Last time around, LeBron flipped the script on his shoe game as only the King can. The encore is even better. With an Air Zoom unit and soft cushioning, the LeBron XXI (also known as the LeBron 21) gives you flexibility and power without a lot of excess weight to slow you down. Ideal for rim runs, fast breaks and racing up and down the court, they help you keep playing at the top of your game until the final buzzer sounds. Are you ready to play?\r\n\r\n\r\nLess Air, more flex\r\n\r\nThe difference between this LeBron and the adult version? We opted for extra flexibility in the forefoot over packing in more Air units for a kid-right fit that\'s perfect for your developing game. A bottom-loaded Air Zoom unit in the heel adds cushioning for when you\'re taking jump shots and making the leap to the next level of your game.\r\n\r\n\r\nDaughter-driven\r\n\r\nWe gave this shoe a shell-like appearance to honour how LeBron feels the need to always protect his daughter, similar to how an oyster shelters a pearl to help it reach its full potential. The colours and graphics of the LeBron XXI nod to this special relationship.\r\n\r\n\r\nFeel the floor\r\n\r\nSoft foam in the midsole feels soft and smooth while keeping you low to the ground, which helps you stay connected to the court.\r\n\r\n\r\nLightweight durability\r\n\r\nThe airy, breathable fabric on the upper is made from a dimensional mesh that\'s lightweight, durable and contained.\r\n\r\n\r\nProduct details\r\n\r\nClassic laces\r\nColour Shown: White/Bicoastal/Photon Dust/Black\r\nStyle: FZ7189-100\r\nCountry/Region of Origin: Vietnam', '4079000', 4, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Kid Boy', '2023-12-24 00:23:06', '2023-12-24 00:23:06'),
('0a91236a-fb6e-4408-acd5-f2132450755f', 'NikeCourt Air Zoom GP Turbo Naomi Osaka Premium', 'Get all dressed up just to go down to the corner shop in this special Naomi Osaka GP Turbo. With sweet, scrumptious nods to some of Naomi\'s favourite snack spots, both near and far, this grab-and-go look will leave you licking your fingers. Subtle odes to her distinctive style and illustrious career accentuate a design worthy of the centre-court spotlight. Made for hard courts, where Naomi crafted a ferocious, fast-paced game, it combines a responsive Zoom Air unit with zones of durability to help you stay fresh for longer.\r\n\r\n\r\nRevolutionary Responsiveness\r\n\r\nWe stitched a full-length Zoom Air unit directly to the upper instead of set into foam, so it responds to every step.\r\n\r\n\r\nDurable design\r\n\r\nReinforced on the inside of the shoe, the anatomically designed toe box provides durability while sliding. Overlays in key places offer flexibility and breathability.\r\n\r\n\r\nSupport for the court\r\n\r\nSee the squiggly lines on the outsole? Those represent the part of the shoe that hugs and supports your foot during quick cuts and fast volleys.\r\n\r\n\r\nProduct details\r\n\r\nDesigned for wear on hard-court surfaces\r\nTranslucent material on upper\r\nColour Shown: Black/Siren Red/Racer Blue/Vivid Sulphur\r\nStyle: FN5714-001\r\nCountry/Region of Origin: China', '4409000', 4, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '3242b7c7-b91c-483f-ae41-49324e83b66e', 'Women', '2023-12-24 00:02:59', '2023-12-24 00:02:59'),
('11fdd926-a92c-4606-ba28-cafb80f69a04', 'Air Jordan 1 Elevate High', 'Classic Jordan style reaches new heights in this lifted AJ-1. The platform stance and high-top collar make a statement, while crisp leather and flashy finishes make these kicks the winning assist your outfit needs. For added flex, the puffy, stitched-on Wings \"logo\" delivers big (and just wait until you feel the ultra-comfortable Air cushioning underfoot). Go ahead, elevate your game.\r\n\r\n\r\nBenefits\r\n\r\nPlatform sole adds style and stability to a classic silhouette.\r\nNike Air technology absorbs impact for cushioning with every step.\r\nClassic cupsole construction gives you durability, traction and support.\r\n\r\nDetails\r\n\r\nPerforated toe\r\nZip side\r\nColour Shown: White/Sail/Desert\r\nStyle: DN3253-121\r\nCountry/Region of Origin: Vietnam', '4539000', 3, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Women', '2023-12-24 00:07:48', '2023-12-24 00:08:01'),
('127c698a-5d4a-43e1-be16-5ed62992b585', 'Nike Go FlyEase', 'Ditch the laces and get outside. These kicks feature Nike\'s revolutionary FlyEase technology, making on-and-off a breeze. With a heel that pivots open for a totally hands-free entry, they\'re great for people with limited mobility—or anyone who wants a quicker way to get going.\r\n\r\n\r\nStep In and Go\r\n\r\nThe entire heel (including the sole) hinges open and stays open until you\'re ready. Just slip in and step down to make the heel move back into place and secure your foot.\r\n\r\n\r\n\"CushIon\" Every Step\r\n\r\nPlush Cushlon foam gives each heel-to-toe transition a smooth, cushioned feeling.\r\n\r\n\r\nLightweight Structure\r\n\r\nAiry fabric in the upper lets your feet breathe while durable, no-sew overlays provide structure and stability.\r\n\r\n\r\nProduct Details\r\n\r\nGrippy rubber outsole\r\nSwoosh design\r\nColour Shown: Black/White\r\nStyle: DR5540-002\r\nCountry/Region of Origin: Vietnam', '4000000', 2, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Men', '2023-12-23 23:03:45', '2023-12-24 20:12:12'),
('13eddadf-b485-4be0-a0f7-4bf1473d548b', 'Chuck Taylor All Star', 'THE STAPLE. The low-cut legend since \'57. The Chuck Taylor All Star Low Top sneaker keeps it classic. Iconic elements like an OrthoLite insole and canvas upper keep it comfortable. You got it.', '1100000', 2, 'image.jpg', '0149a509-9bb8-4524-8b0f-84c48d27ed7f', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Kid Girl', '2023-12-24 01:01:15', '2023-12-24 01:01:15'),
('166be991-dd1d-4802-8057-e367a5404fde', 'Chuck Taylor All Star', 'CHUCK TAYLOR ALL STAR ORIGINS Created in 1917 as a non-skid basketball shoe, the All Star was originally promoted for its superior court performance by basketball mastermind Chuck Taylor. But over the decades, something incredible happened: The sneaker, with its timeless silhouette and unmistakable ankle patch, was organically adopted by rebels, artists, musicians, dreamers, thinkers and originals. Features And Benefits Canvas upper for lightweight, flexible support Rubber outsole for durable traction Medial eyelets enhance ventilation\r\n\r\nSize Disclaimer: There may be a 1-2cm difference in measurements depending on the development and manufacturing process.\r\n\r\nColor Disclaimer: Actual colors may vary. This is due to the fact that every computer monitor has a different capability to display colors, we cannot guarantee that the color you see accurately portrays the true color of the product.', '1100000', 3, 'image.jpg', '0149a509-9bb8-4524-8b0f-84c48d27ed7f', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Kid Boy', '2023-12-24 00:58:47', '2023-12-24 00:58:47'),
('1cd740c2-466a-4656-b1f4-49296daabcb9', 'Nike Invincible 3', 'With maximum cushioning to support every mile, the Invincible 3 is our highest level of comfort underfoot. Its plush and bouncy ZoomX foam helps you stay stable and fresh. In other words—it\'s going to feel good all day, whatever you\'re doing. And when you pair all this cushioning with easy-to-style colours, you get a shoe you never want to stop wearing.\r\n\r\n\r\nSupport: high\r\n\r\nThe more supportive the shoe, the more stability it can give to your natural stride. A combination of tuned support and intentionally placed cushioning helps you feel secure with every step. The Invincible 3 has high-support technology, with cushioning and stability intentionally placed and shaped to help protect your foot from the effects of pronation.\r\n\r\n\r\nCushioning: super-high\r\n\r\nThe more cushioning you have underfoot, the softer and more comfortable your running experience can be. Cushioning helps soften the impact as your feet hit the ground. With Nike ZoomX cushioning shaped like a rocker and higher foam heights, this shoe is so soft and bouncy that just by putting it on you\'ll be excited for your next run. It provides ultimate cushioning on ground contact and an even softer underfoot feel for your workout and beyond.\r\n\r\n\r\nResponsiveness: super-high\r\n\r\nThe more responsive the shoe, the more energy return you can get back with each step. Whether you want to run a little bit faster or with a little less effort, responsive shoes help give you slightly more spring in your step to get more out of your run. Nike ZoomX foam is ultra-responsive and lightweight, giving you bounce and a snappy response with every step.\r\n\r\n\r\nFit: secure, breathable, comfortable\r\n\r\nAn evolved Flyknit upper places zones of breathability where your foot heats up most. It\'s strong and durable, helping keep your foot secure with every mile.\r\n\r\n\r\nWhat\'s new about the Invincible 3?\r\n\r\nA wider midsole adds more stability than our previous iteration. Taller foam stacks than our previous version raise the bar on cushioning and comfort, in a more sleek-looking design. The strong plastic going around the heel is smaller than our previous iteration while still providing a secure, comfortable fit.\r\n\r\n\r\nProduct details\r\n\r\nNot intended for use as personal protective equipment (PPE)\r\nWeight: 258g (women\'s size 5.5)\r\nHeel-to-toe drop: 9mm\r\nAs a result of a design update, the heel text of the product you purchase may be different from the heel text depicted on Nike.com. In case of any questions, please contact Nike consumer service.\r\nColour Shown: Fierce Pink/Pink Blast/Fireberry\r\nStyle: DR2660-602\r\nCountry/Region of Origin: Vietnam', '5279000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Women', '2023-12-23 23:40:44', '2023-12-23 23:40:44'),
('1e873b09-d43e-40ad-85d3-d52e32e62456', 'Nike Air Zoom Arcadia 2', 'It\'s never too early to start. Give your kids those race-day vibes every time they pull on our Nike Air Zoom Arcadia 2. Learning to run and sprint is a breeze with our responsive Zoom Air cushioning. With an improved fit up top and an easy strap, little runners will reach the finishing line in no time.\r\n\r\n\r\nBouncy Cushioning\r\n\r\nSnappy and responsive, Zoom Air cushioning helps provide a quick-off-the-ground sensation. A semi-transparent rubber sole in the heel reveals the Air unit\'s colour.\r\n\r\n\r\nA Fit That Feels Right\r\n\r\nBreathable mesh and stretchy fabric adapt to your feet for a comfortable fit. 2 hidden stretchy bands wrap from the tongue to around the arch to provide support that feels like a big hug.\r\n\r\n\r\nGround Control\r\n\r\nRubber sole provides grip and durable traction while you run. Cut-outs under the forefoot make the shoe lighter and more flexible.\r\n\r\n\r\nMore Benefits\r\n\r\nHook-and-loop strap and elastic laces let little ones slip their kicks on and off easily.\r\nSoft foam provides lightweight cushioning underfoot.\r\nAn extra layer on the toe tip and the sides provides durability.\r\n\r\nProduct Details\r\n\r\nHeel pull tab\r\nExtra lining on the collar and tongue\r\nColour Shown: Phantom/Bright Crimson/White/Dark Obsidian\r\nStyle: DM8492-009\r\nCountry/Region of Origin: Indonesia', '1789000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Kid Boy', '2023-12-24 00:13:33', '2023-12-24 00:13:33'),
('22709097-e2b6-4a1a-ac72-addbacf61d08', 'Nike Infinity Ace Next Nature', 'Your game and your swing can\'t be pigeonholed. The all-new Infinity Ace supports your individuality, the inner independence that allows you to go for the green when the book says go for a lay-up or hit a drive down a narrow fairway when friendlier approaches would suit. With super-soft cushioning around sensitive areas like the ankle and midfoot, it has you ready to play 18.\r\n\r\n\r\nSwing with Force\r\n\r\nDynamic internal support saddle helps keep you steady when swinging with power. Foam in the midsole offers lightweight, all-round comfort.\r\n\r\n\r\nFresh and Cool\r\n\r\nLightweight mesh provides great breathability and keeps you cool and refreshed over the course of a round or more. A leather strip attached to the back of a shoe sole helps keep dew and debris away.\r\n\r\n\r\nConnected in all Conditions\r\n\r\nData-driven rubber traction helps keep you from slipping and sliding in various weather conditions.\r\n\r\n\r\nStay Secure\r\n\r\nA lower, swooping collar helps minimise movement around the ankle and offers excellent support and comfort.', '2929000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'f481b673-2193-4b97-a1ff-d74a6821ad07', 'Women', '2023-12-23 23:58:56', '2023-12-23 23:58:56'),
('236b3032-3a8f-4885-912f-24915c5b851c', 'Freak 5 (Team) EP', 'Giannis\'s internal engine revs from deep within, requiring a shoe that can harness his superpower abilities. Enter the Freak 5. Stacked with stunning speed for super-quick first steps, stuffed with that sort of springy cushioning that can withstand the all-game grind, his signature shoe lets you feel like the Greek Freak. Blow past your opponent en route to the rim while sticking with quick-twitch ball-handlers when a defensive stand decides the game. With its extra-durable rubber outsole, this version gives you traction for outdoor courts.\r\n\r\n\r\nHit the gas\r\n\r\nA top-loaded Zoom Air unit in the forefoot provides energy return and responsiveness, putting force into your first step so you can go from the perimeter to the rim with ease.\r\n\r\n\r\nStay contained\r\n\r\nFor all that force and velocity, Giannis needs a design that stays with him, whatever the defence throws at him. Our internal containment system gives you a more dynamic fit system that limits movement inside the shoe without feeling constricting.\r\n\r\n\r\nComfort for 4 quarters\r\n\r\nThe springy foam midsole has a responsive underfoot ride. It adds a soft, comfortable sensation to help keep you moving and energised all game long.\r\n\r\n\r\nStick and cut\r\n\r\nThe advanced traction in the heel enhances your on-court feel. It helps you stick to the ground for a microsecond, while the other directional traction helps you dig your toe in and out.', '3669000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Men', '2023-12-23 22:32:52', '2023-12-23 22:32:52'),
('2e2595db-bef2-4430-8aca-a5cef0a5e3e4', 'Nike Jr. Phantom GX Academy', 'Looking to take your game to the next level? Academy shoes give you the precision touch you need to let your innermost playing instincts dazzle. Featuring NikeSkin and a mesh touch zone to help enhance your precision, and an agility plate that\'s designed to swerve and sprint with you, it\'s ready to ignite your spontaneous playmaking spirit.\r\n\r\n\r\nEnhanced touch\r\n\r\nAn expanded NikeSkin touch zone, powered by engineered mesh, brings your foot even closer to the ball for better control while dribbling and passing in wet or dry conditions. The upper is soft and almost knit-like while the contact zone on the inside of the shoe is heightened for even better touch.\r\n\r\n\r\nContoured for comfort\r\n\r\nAsymmetry in the heel provides comfort. Soft elements in the heel make for an easy break-in process and help reduce irritation and pressure without compromising stability and structure.\r\n\r\n\r\nTurf Traction\r\n\r\nA generative texture outsole gives you traction on turf surfaces.\r\n\r\n\r\nEasy On\r\n\r\nBetter yet, there\'s no need to tie these! Pull tabs and an adjustable tongue offer your young star an easy slip-on solution, so they can play fast and free. The elastic laces offer adaptable lockdown.\r\n\r\n\r\nProduct details\r\n\r\nFor use on shorter, synthetic surfaces\r\nCushioned insole\r\nColour Shown: Hyper Turquoise/Fuchsia Dream/White/Black\r\nStyle: DD9557-300\r\nCountry/Region of Origin: Indonesia', '1889000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Kid Boy', '2023-12-24 00:27:35', '2023-12-24 00:27:35'),
('3489f4fc-0ea8-437f-a7ff-d2005e4f0286', 'Run Star Legacy Chelsea CX Mono', 'FUTURE FAVORITE An evolution of the fan-favorite Run Star Hike, the Run Star Legacy Chelsea CX mixes bold platform styling with premium comfort and easy accessibility. A lightweight CX midsole and sockliner keep you light on your feet, while distorted Chuck Taylor design elements keep them guessing. A luxe take on the original, this edition pairs a monochrome, full-grain leather upper with a stretchy collar and zippered closure for everyday versatility. Features And Benefits High-top platform shoe with full-grain leather upper A CX foam midsole and sockliner keep it lightweight and comfortable Tonal, neutral design for versatile styling Faux leather overlays for expressive style Stretchy collar and zip-front closure for easy on and off', '3300000', 2, 'image.jpg', '0149a509-9bb8-4524-8b0f-84c48d27ed7f', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Women', '2023-12-24 00:45:21', '2023-12-24 00:45:21'),
('34bb4cd1-b629-4e25-87c7-050f97d20159', 'KD15 EP', 'Game-making plays and impossible shots are all in a day\'s work for Kevin Durant. Give him the ball and he makes the game look easy. The KD15 is stripped down to provide just what he wants: plenty of bounce, a secure fit and a broken-in feel. Fewer materials underfoot and throughout the upper helps minimise distractions while optimising energy return and all-round comfort—vital for players like KD who never stop moving. This special KD15 salutes hip-hop\'s 50th anniversary with nods to the past and present. This version is designed for outdoor court use with its extra-durable outsole.\r\n\r\n\r\nBehind the Design\r\n\r\nOn the 50th anniversary of its advent, this look draws inspiration from the hip-hop influencers and impact forces who have left their indelible imprint on the music industry. Rock the mic with a cool hangtag around the collar, and check out the tongue label that pays homage to vintage party posters from back in the day. Look for the advisory sticker-inspired insoles that celebrate both the golden and current eras of hip-hop.\r\n\r\n\r\nLace Up, Lock In\r\n\r\nThe laces feed through floating wings along the sides. When you tighten the laces, the wings are pulled down to help hold your foot in place.\r\n\r\n\r\nSmooth, Springy Sensation\r\n\r\nSoft, full-length foam plus a visible Zoom Air Strobel unit provide a dual layer of cushioning that\'s soft, smooth and responsive. It eliminates the need for extra layers and brings the energy-returning sensation right up under your foot.\r\n\r\n\r\nBroken-In Comfort\r\n\r\nReduced layers throughout the upper strip away unnecessary weight to enhance the feeling of broken-in comfort.\r\n\r\n\r\nGrip and Go\r\n\r\nThe outsole pattern looks like a topographical map, with an array of contoured ridges that bend and deflect in multiple directions to provide traction for every move. \"EASY\" is moulded into the rubber in a nod to KD\'s effortless game.\r\n\r\n\r\nMore Benefits\r\n\r\nThin overlays help resist abrasion along the toe.\r\nKD logo is moulded on the tongue.\r\nColour Shown: White/Volt/Photon Dust/Black\r\nStyle: FN8009-100\r\nCountry/Region of Origin: Vietnam', '4409000', 1, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Women', '2023-12-23 23:47:15', '2023-12-23 23:47:15'),
('3b4f8dae-a89e-4055-a982-ec472f41cdba', 'Nike Air Force 1 Shadow', 'DOUBLE THE SWOOSH.\r\n\r\n\r\nThe Nike Air Force 1 Shadow puts a playful twist on a classic b-ball design. Using a layered approach, doubling the branding and exaggerating the midsole, it highlights AF-1 DNA with a bold, new look.\r\n\r\n\r\nBenefits\r\n\r\nFeaturing the same iconic shape as the original Air Force 1, a slightly exaggerated midsole makes the shoe instantly recognisable while also playing with proportions.\r\nA foam midsole and grooved outsole ensure that the shoe is lightweight, flexible and comfortable.\r\nWith 2 eyestays, 2 mudguards, 2 backtabs and 2 Swoosh designs, you get a layered look with double the branding.\r\n\r\nProduct Details\r\n\r\nMix of leather and synthetic materials\r\nRubber tape\r\nColour Shown: Sail/Sail/Grey Fog/Pale Ivory\r\nStyle: DO7449-111\r\nCountry/Region of Origin: China', '3239000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Women', '2023-12-23 23:36:00', '2023-12-23 23:36:00'),
('4605621a-59de-4094-8750-03201c2a3923', 'Jordan Retro 6 G NRG X', 'Feel unbeatable from the tee box to the final putt in a design is pure early MJ: speed, class and laden with true early \'90s touches like visible Air and a translucent plastic sole that continue to stand the test of time. This model fuses the strut of 1st MJ\'s championship with some of our best golf technology, helping you make a statement of confidence when it comes time to tame the course. With its deep, rich red accents and creamy white tones, this version celebrates MJ\'s favourite beverage, 1 that goes down smooth with a big plate of barbecue and a side of American cobbler while basking in warm-hearted hospitality.\r\n\r\n\r\nAJ 6 Inspiration\r\n\r\nMJ\'s German sports car served as the inspiration for the original shoe\'s design, with its very essence conveying speed and class. A moulded heel tab is on the back of the sneaker, something Jordan himself required back in \'91 so that it wouldn\'t hit his Achilles tendon when putting on the shoe. Two holes in the tongue are a nod to the original AJ 5.\r\n\r\n\r\nCourse Traction\r\n\r\nA golf-specific to provide more freedom of movement to release more power through the golf swing.\r\n\r\n\r\nMore Benefits\r\n\r\nProvides water resistance in all weather conditions.\r\nLightweight foam midsole provides comfort and stability throughout your round.', '6459000', 8, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', 'f481b673-2193-4b97-a1ff-d74a6821ad07', 'Men', '2023-12-23 23:16:59', '2023-12-23 23:18:37'),
('480c231f-b9cf-41af-8b6a-17f6d023aea9', 'Nike Metcon 9', 'Whatever your \"why\" is for working out, the Metcon 9 makes it all worth it. We improved on the 8 with a larger Hyperlift plate and added rubber rope wrap. Intended for lifters, trainers and go-getters, some of the greatest athletes in the world swear by it, and it\'s still the gold standard that delivers day after day.\r\n\r\n\r\nTougher and Stronger\r\n\r\nWe made the Hyperlift plate in the heel even bigger for stability when tackling tough workouts like Split Squats, Dead Lifts and other lower-body exercises. The plate helps force weight down and out while adding rigidity in the heel. That firmness helps you feel grounded and supported, specifically under heavier loads.\r\n\r\n\r\nSecure feel\r\n\r\nThe lace-lock system attaches to the shoe tongue, so you don\'t have to worry about latching it to any fabric. It helps keep your laces in place, so once you tie up, you can focus solely on your workout.\r\n\r\n\r\nGo to the Top\r\n\r\nWe extended the rubber wrap on the side for durability and support so that you can scale any kind of rope climb with the same repeated velocity without worrying about wear and tear. It stretches from the midsole to the upper and adds some support in the upper for multi-directional movements.\r\n\r\n\r\nDurable and Cool\r\n\r\nThe lightweight, breathable mesh helps keep your foot cool yet sports the kind of durability that can withstand scrapes, slashes and quick-drag movements.\r\n\r\n\r\nFeel the Foam\r\n\r\nA dual-density midsole—firm foam on the outside, soft foam on the inside—provides responsive cushioning for lasting comfort for continuous cardio and movements.\r\n\r\n\r\nMore benefits\r\n\r\nA full-rubber outsole provides durable traction for dynamic movements like Cleans and Walking Lunges.\r\nBreathable textile has a haptic print, which creates a 3D effect that adds durability and texture, helping make it easier to keep your shoes clean. Also, it provides flexible, durable support in the toe area so that when your toes splay when lifting heavy weights, it won\'t feel restrictive.\r\nColour Shown: Bordeaux/Vivid Purple/Volt/Black\r\nStyle: DZ2537-603\r\nCountry/Region of Origin: Vietnam', '4109000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '6707e838-ee4f-4baf-8e09-1aba1af255ae', 'Women', '2023-12-23 23:57:00', '2023-12-23 23:57:00'),
('4e00c890-9d7c-4de1-964f-12a3d687f481', 'Nike Defy All Day', 'Take on everyday challenges in the Nike Defy All Day. Leather up top and rubber traction on the bottom create a durable design that lasts the rigours of tough training sessions. Soft cushioning carries comfort through your workout—or a day of getting things done.\r\n\r\n\r\nDurable Design\r\n\r\nTough leather on the upper stands up to the demands of your workout. Built-in breathability helps your foot stay cool.\r\n\r\n\r\nComfort All Day\r\n\r\nFoam cushioning, a soft insole and padding around the ankle put comfort where it counts—whether you\'re in or out of your training zone.\r\n\r\n\r\nTraction With Flex\r\n\r\nRubber tread gives you durable traction on a range of surfaces. Grooves underfoot let the sole flex as you step.\r\n\r\n\r\nProduct Details\r\n\r\nPull tab on the heel\r\nColour Shown: Black/White/Black\r\nStyle: DJ1196-002\r\nCountry/Region of Origin: Indonesia', '1909000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '6707e838-ee4f-4baf-8e09-1aba1af255ae', 'Men', '2023-12-23 22:55:29', '2023-12-23 22:55:29'),
('4eaf5df1-a5a7-4870-b70a-04f0e8584a16', 'Nike Vaporfly 3', 'Catch \'em if you can. The Vaporfly 3 is made for the chasers, the racers and the elevated pacers who can\'t turn down the thrill of the pursuit. We reworked the leader of the super shoe pack and tuned the engine underneath for those who see speed as a gateway to more miles and more seemingly uncatchable highs. This versatile road-racing workhorse is built for all athletes chasing personal bests from a 10K to a marathon. So look fast, feel fast in this bright, colour-duelling edition of a legend.\r\n\r\n\r\nSpeed for Miles\r\n\r\nOur most resilient foam just got a little better. Nike ZoomX cushioning unlocks even more energy return than before and helps reduce weight with a convex shape on the inside of the foot for a more stable ride. A full-length, carbon-fibre plate provides a stiff and propulsive feel.\r\n\r\n\r\nFeel the Breeze\r\n\r\nSpecifically selected Flyknit yarns and engineered zones in the forefoot bring a new level of performance to the Vaporfly. Ample breathability around the toes combined with soft, yet supportive yarns deliver our most customised upper for the Vaporfly. The result is a softer, cooler design that contours to your foot.\r\n\r\n\r\nSmooth and Steady\r\n\r\nAn updated thin outsole rubber uses less material without sacrificing durability, which helps reduce outsole weight and thickness. This allows for extra millimetres of ZoomX foam underfoot and smoother transition through your stride.\r\n\r\n\r\nMore benefits\r\n\r\nLight padding on the tongue helps reduce lace pressure at the top of your foot.\r\nAn updated Waffle outsole pattern with perforations reduces weight and delivers multi-surface traction in various weather conditions.\r\nOffset heel seam helps reduce friction in the heel area.\r\nWider toe area creates a roomier fit.\r\nThe internal foam pod in the heel provides targeted cushioning.\r\n\r\nProduct details\r\n\r\nWeight: 200g (men\'s size 9)\r\nHeel-to-toe drop: 8mm\r\nColour Shown: Luminous Green/Crimson Tint/Volt/Black\r\nStyle: FQ8109-331\r\nCountry/Region of Origin: China', '7629000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-23 22:25:04', '2023-12-23 22:25:04'),
('5011278e-c2ee-4ae4-af34-91570a294084', 'Nike Phantom Luna', 'Your game is full of undeniable, all-round playmaking force. The bigger the moment, the brighter the lights, the better you play. Let the Phantom Luna help your skills shine. We used insights from female athletes to give you a traction pattern that helps you play quickly and with confidence—which every footballer needs. It helps you make precision cuts when the match\'s intensity heats up, while innovative NikeSkin brings your foot closer to the ball.\r\n\r\n\r\nTraction for the pitch\r\n\r\nThe Nike Cyclone 360 traction pattern unlocks quick and safe movements, so you can cut with speed and force while feeling fully secure when the game\'s intensity turns up.\r\n\r\n\r\nAmplified touch\r\n\r\nAn expanded NikeSkin touch zone, powered by engineered mesh, brings your foot even closer to the ball for better control while dribbling and passing in wet or dry conditions. The upper is soft and almost knit-like while the contact zone on the inside of the boot is heightened for even better touch.\r\n\r\n\r\nSecure Fit and Feel\r\n\r\nThe flat knit cuff material provides snugness and shape. Subtle ribs in the cuff allow for ball contact higher up the ankle in trapping and passing. Asymmetric lacing offers a larger touch surface when dribbling, passing and scoring. The asymmetric heel construction gives you all-game comfort and eases the initial break-in process.\r\n\r\n\r\nProduct details\r\n\r\nFor use on slightly wet, short-grass pitches\r\nCushioned insole\r\nColour Shown: Hyper Turquoise/Fuchsia Dream/Black\r\nStyle: FN8406-300\r\nCountry/Region of Origin: Indonesia', '3519000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Men', '2023-12-23 22:51:46', '2023-12-23 22:51:46'),
('51c427f7-22e9-4579-a338-39e220f300ac', 'Air Jordan 1 Zoom CMFT 2', 'Soft suede and Jordan Brand\'s signature Formula 23 foam come together to give you an extra luxurious (and extra cosy) AJ1. You don\'t need to play \"either or\" when it comes to choosing style or comfort with this one—which is nice, \'cause you deserve both.\r\n\r\n\r\nBenefits\r\n\r\nNike Air technology absorbs impact for cushioning with every step.\r\nSuede on the upper and toe breaks in easily and contours to your feet.\r\nFormula 23 foam keeps your feet extra padded.\r\nColour Shown: Muslin/Blackened Blue/Coconut Milk/Black\r\nStyle: DV1305-104\r\nCountry/Region of Origin: Indonesia', '4259000', 2, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Women', '2023-12-24 00:09:43', '2023-12-24 00:09:43'),
('5673e923-434d-4067-b807-db93c18734c8', 'Nike Jr. Mercurial Superfly 9 Club Mercurial Dream Speed', 'Your little star puts in the practice—after school, at break time, on weekends—just like Cristiano Ronaldo did in his younger days. Now they\'re ready to put all that hard work into the game. Bold reds and gentle oranges represent the passion and preparation your little one puts into their favourite sport. These boots have a textured design that helps with ball control while kids shoot at the goal or pass to their teammates.\r\n\r\n\r\nExceptional Touch\r\n\r\nSynthetic leather upper has small textured details that provide grip for better ball control when dribbling at quick speeds.\r\n\r\n\r\nDig in, take off\r\n\r\nDesigned for various surfaces, conical studs offer super-charged traction with quick release and pivoting.\r\n\r\n\r\nSeamless Design\r\n\r\nA comfortable lining wraps kids\' feet for a natural, close-fitting feel.\r\n\r\n\r\nProduct details\r\n\r\nClassic laces\r\nFor use on natural and synthetic surfaces\r\nCushioned insole\r\nColour Shown: Light Crimson/Bright Mandarin/Black/Pale Ivory\r\nStyle: FJ0351-600\r\nCountry/Region of Origin: Vietnam', '1759000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Kid Boy', '2023-12-24 00:26:37', '2023-12-24 00:26:37'),
('5827e27b-0bd4-40c1-b7ad-dfcc0bd89b05', 'Air Jordan XXXVIII Rui PF', 'Decked out in colour-shifting details, the Air Jordan XXXVIII Rui player exclusive is inspired by the seasonal mirages of the Toyama Prefecture where Rui grew up. All the game-ready tech you expect is there too, like low-to-the-court cushioning and a secure upper that helps support every move. Rui\'s logo, a combination of the letter \"H\" and his lucky number 8, adds his personal touch to the design.\r\n\r\n\r\nCourt mobility\r\n\r\nQuick cuts, speedy sprints and all-over court control—that\'s what you want. It\'s the low-to-the-court Zoom Strobel Air unit that helps you achieve it.\r\n\r\n\r\nStrength + security\r\n\r\nThe embroidery in the upper is designed to help you feel extra secure while criss-crossing the court. Your skills, plus supportive, lightweight mesh? A winning combo.\r\n\r\n\r\nHeritage details\r\n\r\nBaked right into the shoe\'s design are shout-outs to MJ\'s legendary \'93 season. Cross-hatches, chevrons and lines of ribbing on one shoe represent his points, assists and rebounds per game. Fabric details on the other nod to the 57-25 season record—and MJ\'s third consecutive championship.\r\n\r\n\r\nWaste not, want not\r\n\r\nThe last thing we need is more waste. A special Move to Zero box gives you the bells and whistles of commemorative packaging without the extra rubbish.\r\n\r\n\r\nProduct details\r\n\r\nThe PF edition is designed with a wider fit and optimised for play on outdoor courts.\r\nColour Shown: Photon Dust/Mint Foam/Siren Red/Off-Noir\r\nStyle: FD0583-003\r\nCountry/Region of Origin: Vietnam', '6179000', 7, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Men', '2023-12-23 22:41:52', '2023-12-23 22:41:52'),
('58b0519a-85bd-475b-982b-684e5454b29a', 'Nike Pegasus Turbo', 'Let this esteemed stallion help you log the hard miles. Complete with lighter, responsive, repurposed foam and a feather upper, this motley-coloured mare is made to help you increase tempo without sacrificing comfort as you push towards a personal best. This immortal is responsibly constructed with at least 50% recycled material by weight, while maintaining its tried-and-tested everyday ethos.\r\n\r\n\r\nA More Responsive Ride\r\n\r\nNike ZoomX foam is responsive and lightweight, giving you bounce with every step. Shaped like a rocker, the foam provides support for the 3 phases of a runner\'s stride. It offers flexibility when your foot rises off the ground, a smooth ride when your foot is moving forwards and cushioning at ground contact.\r\n\r\n\r\nLightweight and Supportive\r\n\r\nFlyknit technology uses high-strength fibres to create a lightweight upper with targeted areas of support, stretch and breathability. It provides security and comfort.\r\n\r\n\r\nTraction for the Road\r\n\r\nWaffle-inspired tread on the outsole provides traction.', '4409000', 8, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-23 22:21:25', '2023-12-23 22:21:25'),
('592377e7-fbb5-4362-a5d1-72e1cd03a2f2', 'NikeCourt Vapor Lite 2 Premium', 'Simple, but sleek. Subtle yet studded out with playability, speed and support. The Vapor Lite 2 is ready for the court right out of the box and offers comfort for the players who like to do it all. With a familiar, super-comfortable underfoot feeling, they can help you hammer that volley at the net and stay mobile during a long rally with optimal traction. Once your session is complete, it\'s comfortable enough to wear walking off the court into wherever your day leads next. To top it off, we gave this look a multicolour glow that\'s sure to help your game steal the spotlight.\r\n\r\n\r\nCushioning for Your Match\r\n\r\nWith a plush 2-level foam system, this design helps keep you comfortable and motoring for point after point.\r\n\r\n\r\nBreathable and Durable\r\n\r\nExtra-durable mesh helps keep your feet cool. A moulded rubber overlay on the front of the shoe adds durability.\r\n\r\n\r\nBuilt to Bank\r\n\r\nSoft foam near the arch makes it easier to align your ankle with your foot while banking. Harder foam along the outside helps you push off during fast movements, whether you\'re playing tennis or pickleball.\r\n\r\n\r\nMore benefits\r\n\r\nThe herringbone outsole uses a data-informed design to create optimal grip without impacting your ability to slide. It pays homage to some of the best designs in our Vapor line.\r\nWe removed rubber in low-wear areas to help keep weight at a minimum.\r\nFull-length foot frame on the outside helps stabilise your foot during quick cuts.\r\nColour Shown: Fireberry/Multi-Colour/Fierce Pink/Metallic Red Bronze\r\nStyle: FB7065-600\r\nCountry/Region of Origin: Indonesia', '2649000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '3242b7c7-b91c-483f-ae41-49324e83b66e', 'Women', '2023-12-24 00:00:57', '2023-12-24 00:00:57'),
('5a45736b-b809-44dc-bc7c-d2ae9d794a5e', 'Air Jordan 1 Mid', 'Inspired by the original AJ1, this mid-top edition maintains the iconic look you love while choice colours and crisp leather give it a distinct identity.\r\n\r\n\r\nBenefits\r\n\r\nLeather, synthetic leather and textile upper for a supportive feel.\r\nFoam midsole and Nike Air cushioning provide lightweight comfort.\r\nRubber outsole with pivot circle gives you durable traction.\r\nColour Shown: White/Black/Gym Red\r\nStyle: DQ8426-106\r\nCountry/Region of Origin: Indonesia', '3669000', 5, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Men', '2023-12-23 23:01:14', '2023-12-23 23:01:54'),
('5fcf6ac3-b8d5-4e44-9929-d49274b8963f', 'Nike Air Zoom Pegasus 40', '40 years. Generations of running. The Pegasus 40 reps the past and future of Nike Running. Whether you\'re gearing up for a school athletics competition, athletics training or fun runs (like your gym class mile), this shoe is for runners of all levels. They\'re breathable so your feet stay cool with every lap. Zoom Air and bouncy foam team up for the cushioning you need to feel comfortable with every stride. It\'s time to fly!\r\n\r\n\r\nBreathable Comfort\r\n\r\nThe soft engineered mesh has 3 advantages to help your next run: Lightweight so you can feel fast. Structured fit for stability. And breathability for airflow so your feet stay cool.\r\n\r\n\r\nKid-Right Cushioning\r\n\r\nMade especially for kids\' feet and for running, our Cushlon foam gives a responsive and bouncy feel with every stride. A Zoom Air unit in the forefoot brings a quick off-the-ground sensation.\r\n\r\n\r\nGround Control\r\n\r\nThe rubber sole has a waffle-inspired traction pattern to help grip surfaces and provide durability. The cut-out grooves increase flexibility for a better transition from heel to toe.\r\n\r\n\r\nMove with Stability\r\n\r\nA synthetic leather midfoot band stretches across the top to give you a secure and stable feel while running and moving in different directions.\r\n\r\n\r\nMore Benefits\r\n\r\nAn extra skin layer across the toe tip provides added durability for those who drag their toes.\r\nThe padded foam collar gives extra comfort and support around the ankle.\r\n\r\nProduct Details\r\n\r\nClassic laces\r\nColour Shown: Platinum Tint/White/Green Strike/Black\r\nStyle: DX2498-006\r\nCountry/Region of Origin: Vietnam', '2679000', 4, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Kid Boy', '2023-12-24 00:20:22', '2023-12-24 00:20:22'),
('604397bc-c55c-456a-8b51-6bc872dde68e', 'KD16', 'Kevin Durant\'s bag? Bottomless. His range? Limitless. Your customisation choices for the KD16 By You? Take a guess. A fresh colour palette and enough design options to satisfy even the most avid artist highlight a shoe bent on giving you breathing room to cook. Top it off with several different tongue and collar choices that\'ll help your game beam. Nike Air and Zoom Air work together to provide speed and stability for all 4 quarters, while the upper is lower and the overall load is lighter compared with the 15. It\'s ideal for the hoopaholic who can\'t say no to just one more game.\r\n\r\nCOLOUR THE UPPER\r\n\r\nWith everything from Metallic Gold and Silver to Vivid Purple, Volt and Hyper Pink, you can perk up various parts of the upper. Choose from 11 different colours to make KD\'s logo pop, highlighted by Pink Foam, Vivid Orange and metallics. You can touch up the base of the tongue and the collar lining too, like a 3D iridescent skin with a multi-colour hue or 15 different selections, if you choose to keep it the same.\r\n\r\nCOLOUR THE MIDSOLE\r\n\r\nChoose between a solid or gradient midsole colour. If you go with solid, you can speckle the midsole and pick between 16 various dotted-looking options.\r\n\r\nMAKE IT PERSONAL\r\n\r\nAdd a personal touch to this special KD16 with your initials, number or something else unique. It appears on the back of the tongue lining in KD\'s signature font, using 1–2 characters, numbers 0–9 and letters A–Z.\r\n\r\nCUSHION AND COMFORT\r\n\r\nA lightweight Nike Air unit on the bottom of the upper gives KD the cushioning and comfort he needs to thrive during a long season.\r\n\r\nHIGH-SPEED HAVEN\r\n\r\nKD loved the 15\'s underfoot experience, so we took inspiration from the previous iteration and added a bottom-loaded forefoot Zoom Air unit for extra pop and snappiness when the game hits high speeds. Responsive full-length foam adds a soft, comfortable sensation.\r\n\r\nGROOVE AND MOVE\r\n\r\nGrooves and ridges in the sole help provide multi-directional traction and court feel. A stiff piece under the arch helps keep the shoe stable and help you smoothly transition from heel to toe.\r\n\r\nMORE BENEFITS\r\n\r\nMulti-layer mesh in the upper is lightweight and dimensional with a broken-in feel. Added thickness in strategic areas helps to keep your foot in place by reducing small movements. The outsole resembles watch gears, which represent the inner workings of KD and the methodical nature of how he operates.\r\n\r\nPRODUCT DETAILS\r\n\r\nOur Members are one of a kind, and your shoes are too. Each pair is proudly made one at a time, by hand. Good things are worth the wait.\r\nWith our 3D builder, watch your creation come alive as you experiment with all kinds of design choices.', '5589000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Women', '2023-12-23 23:49:56', '2023-12-23 23:49:56'),
('68a95282-0148-4808-ad88-6e401c6b1695', 'Nike Zoom Fly 5 Premium', 'Bridge the gap between your weekend training and race day. The Nike Zoom Fly 5 can be deployed not just at the starting line of your favourite race, but in the days and months after your conquest. It offers comfort and reliability with a propulsive sensation that can help you feel fast and fresh. That kind of versatility is uncommon in the running arena. But who says you can\'t have it all?\r\n\r\n\r\nMore bounce\r\n\r\nNewly implemented ZoomX foam in the midsole takes an already respected, trusted shoe to a performance level that wasn\'t present in the Zoom Fly 4. The addition makes for a lighter, more responsive cushioning system. Take advantage of these all-purpose traits that help you have more fun on your runs.\r\n\r\n\r\nStay in rhythm\r\n\r\nFull-length articulated plate delivers a propulsive sensation and a smooth transition at various paces. The plate provides a sort of roll-forwards feel that makes you want to take on the next step.\r\n\r\n\r\nStability When You Need It\r\n\r\nBoth the forefoot and heel offer slightly wider bases for a stable platform, so you can tackle turns and long runs with confidence.\r\n\r\n\r\nMore benefits\r\n\r\nThe lightweight mesh on the upper creates a more breathable feel that moulds to your foot.\r\nThe supportive lacing and midfoot containment wrap around your foot for a contoured and secure fit.\r\n\r\nProduct details\r\n\r\nWeight: 314g (men\'s size 9)\r\nHeel-to-toe drop: 10mm\r\nReflective design details\r\nNot intended for use as personal protective equipment (PPE)\r\nColour Shown: Luminous Green/Volt/Lime Blast/Black\r\nStyle: FQ8112-331\r\nCountry/Region of Origin: Vietnam', '4999000', 6, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-23 22:23:16', '2023-12-23 22:23:16'),
('75741427-85fb-47cc-b29d-516e33963bdc', 'Nike Air Zoom Infinity Tour NEXT%', 'We listened to the feedback you had on the Infinity Tour, refined it and brought it to life on the Nike Air Zoom Infinity Tour NEXT%. We increased the overall volume to give your foot more room, put an extra Zoom Air unit in the forefoot for even more energy transfer through your swing and added more traction in key areas to help reduce slipping. The result is an incredibly responsive, comfortable shoe that we know you\'re going to love.\r\n\r\n\r\nBreathable Comfort\r\n\r\nBreathable textile helps your foot stay cool. The material hugs and supports you through every step for extra support and comfort. A plush, padded collar helps reduce heel slip while you move.\r\n\r\n\r\nDynamic Response\r\n\r\nThe large forefoot Zoom Air units respond to every step. Because it\'s not fully enclosed, the Air unit can move with your foot, allowing for better energy return when you push off through your swing.\r\n\r\n\r\nOptimal Grip\r\n\r\nPiston spikes and a data-informed traction pattern give you exceptional grip. The spikes are placed under the Zoom Air units and are designed to compress with pressure for better energy return and added comfort throughout your round.\r\n\r\n\r\nMore Benefits\r\n\r\nNike React technology is a lightweight, durable foam that delivers a smooth, responsive ride.\r\nGusset on the tongue makes it easier to get your shoes on and off while also adding extra side-to-side support.\r\nColour Shown: Photon Dust/Volt/Emerald Rise/Black\r\nStyle: DM8446-001\r\nCountry/Region of Origin: China', '4699000', 6, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'f481b673-2193-4b97-a1ff-d74a6821ad07', 'Men', '2023-12-23 23:15:18', '2023-12-23 23:15:18'),
('7696d166-4e75-4fa3-ab6c-f98e193b2f62', 'NikeCourt Zoom Vapor Cage 4 Rafa', 'Innovated to withstand your toughest matches, this updated design puts flexible, durable materials exactly where they\'re needed most. Signature Rafael Nadal details let you rep your favourite player while you run the court.\r\n\r\n\r\nRep Rafa\r\n\r\nCelebrate your favourite player with Rafa\'s iconic Bull logo on the tongue and \"Rafa\" on the heel.\r\n\r\n\r\nExceptionally Durable\r\n\r\nThe data-informed design places flexible, durable materials exactly where they\'re needed the most. The outsole material wraps over the midsole on the medial side for durability.\r\n\r\n\r\nSupportive Feel\r\n\r\nUnique lacing wraps your foot for support while you move.The medial eyestays are covered for added durability while sliding.\r\n\r\n\r\nResponsive Cushioning\r\n\r\nA Zoom Air unit beneath your forefoot creates a springy sensation with every step.\r\n\r\n\r\nMore Benefits\r\n\r\nStiff frame on the lateral side creates a stable feel during side-to-side movements.\r\n1/2-length sleeve gives you a sock-like fit.\r\nDesigned for use on hard court surfaces.\r\n\r\nProduct Details\r\n\r\nRemovable insole\r\nColour Shown: Deep Jungle/Deep Jungle/Lime Ice\r\nStyle: DD1579-301\r\nCountry/Region of Origin: China', '4409000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '3242b7c7-b91c-483f-ae41-49324e83b66e', 'Men', '2023-12-23 23:23:01', '2023-12-23 23:23:01'),
('79333c5b-5b2f-4b5c-9555-dd75cb6471a5', 'Jordan Retro 6 G NRG', 'One of the reasons why MJ loves golf so much: it\'s like looking into a mirror. The only opponent he sees is staring right back at him. No teammates to play off. No defender to go at. Just him, his swing and the course. This special Jordan Retro 6, with its metallic finishes, chrome aglets and glossy Air Jordan details, takes inspiration from the internal drive that inspires both MJ and us to keep getting better every day.\r\n\r\n\r\nAJ6 Inspiration\r\n\r\nMJ\'s German sports car served as the inspiration for the original shoe\'s design, with its very essence conveying speed and class. A moulded heel tab is on the back of the shoe, something Jordan himself required back in \'91 so that it wouldn\'t hit his Achilles tendon when putting it on. Two holes in the tongue nod to the original AJ5.\r\n\r\n\r\nCourse Traction\r\n\r\nSpikes on the outsole add grip and stability for the course.\r\n\r\n\r\nMore benefits\r\n\r\nProvides water repellency in all weather conditions.\r\nLightweight foam midsole provides comfort and stability throughout your round.\r\n\r\nProduct details\r\n\r\nCushioned insole\r\nColour Shown: Photon Dust/White/Metallic Silver\r\nStyle: FD6719-001\r\nCountry/Region of Origin: China', '6459000', 7, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', 'f481b673-2193-4b97-a1ff-d74a6821ad07', 'Men', '2023-12-23 23:09:44', '2023-12-23 23:09:44');
INSERT INTO `products` (`product_id`, `product_name`, `desciption`, `default_price`, `default_stock_quantity`, `image`, `brand_id`, `category_id`, `gender`, `created_at`, `updated_at`) VALUES
('7cbdf4c9-791a-4110-9c82-f1acf8ad2e19', 'Nike Mercurial Superfly 9 Academy', 'Instantly tilt the pitch in the bold design of the Superfly 9 Academy MG. It\'s loaded with a Zoom Air unit and flexible NikeSkin at the top for exceptional touch, so you can dominate in the waning minutes of a match—when it matters most. Fast is in the Air.\r\n\r\n\r\nWelcome to the pitch, Zoom\r\n\r\nFor the first time in our history, Nike has developed an all-new Zoom Air unit. It sits in the plate and provides an additional level of springy underfoot feel that helps you move faster on the pitch and create separation when it matters the most—whether you\'re scoring goals, being first to the ball or going by defenders.\r\n\r\n\r\nDrive your speed\r\n\r\nThe speed cage inside the structure is made from a thin but strong material that secures the foot to the outsole without adding additional weight for optimal lockdown.\r\n\r\n\r\nDig in, take off\r\n\r\nUnique traction pattern offers super-charged traction with quick release to create separation.\r\n\r\n\r\nImproved fit\r\n\r\nFlyknit wraps your ankle in soft, stretchy fabric for a secure feel. A redone design improves the fit, so that it better simulates the foot. We did this by conducting multiple wear tests on hundreds of athletes. The result is a more contoured toe box and better lockdown in the heel.\r\n\r\n\r\nBarefoot feel\r\n\r\nThe upper has NikeSkin, a soft and flexible mesh material linked together by a thin coating. It helps provide ball control and truly gives you a feeling of barefoot football.\r\n\r\n\r\nProduct details\r\n\r\nFor use on natural and synthetic surfaces\r\nCushioned insole\r\nColour Shown: Black/Hyper Royal/Chrome\r\nStyle: DJ5625-040\r\nCountry/Region of Origin: China', '2779000', 4, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Men', '2023-12-23 22:49:58', '2023-12-23 22:49:58'),
('7d0fab10-76cd-4ff0-831f-4d2900559bdd', 'Nike Mercurial Vapor 15 Elite', 'The pitch is yours when you lace up in the Vapor 15 Elite FG. We added a Zoom Air unit, made specifically for football, and grippy texture up top for exceptional touch, so you can dominate in the waning minutes of a match—when it matters most. Feel the explosive speed as you race around the pitch, making the critical plays with velocity and pace. Fast is in the Air.\r\n\r\n\r\nWelcome to the pitch, Zoom\r\n\r\nFor the first time in our history, Nike has developed an all-new, football-specific 3/4 Zoom Air unit. It sits in the plate and provides an additional level of springy underfoot feel that helps you move faster on the pitch and create separation when it matters the most—whether you\'re scoring goals, being first to the ball or going by defenders.\r\n\r\n\r\nDrive your speed\r\n\r\nThe speed cage inside the structure is made from a thin but strong material that secures the foot to the outsole without adding additional weight for optimal lockdown.\r\n\r\n\r\nDig in, take off\r\n\r\nTri-star studs provide multi-directional traction with every step, so you can change directions quickly and confidently. Heel studs provide traction and stability when braking. Toe-off centre studs give you traction during explosive starts.\r\n\r\n\r\nImproved fit\r\n\r\nA redone design improves the fit, so that it better simulates the foot. We did this by conducting multiple wear tests on hundreds of athletes. The result is a more contoured toe box and better lockdown in the heel.\r\n\r\n\r\nFeel the ball\r\n\r\nThe upper is made from Vaporposite+, which combines a grippy, grid mesh with a premium material for optimal ball control at high speeds. The material provides a tactile feel across the surface of the upper. It\'s soft but stable, and wraps tightly around your foot, giving you a more natural on-ball feel when dribbling, passing or scoring.\r\n\r\n\r\nProduct details\r\n\r\nFor use on slightly wet, short-grass pitches\r\nCushioned insole\r\nColour Shown: Black/Hyper Royal/Chrome\r\nStyle: DJ4978-040\r\nCountry/Region of Origin: China', '7319000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Men', '2023-12-23 22:45:55', '2023-12-23 22:45:55'),
('8180ff8e-d010-4abd-8078-caabe22455a3', 'Nike Tiempo Legend 10 Club', 'Even Legends find ways to evolve. Whether you\'re starting out or just playing for fun, the latest iteration of this Club boot gets you on the pitch without compromising on quality. The synthetic leather contours to your foot and doesn\'t overstretch, giving you better control. Lighter and sleeker than any other Tiempo to date, the Legend 10 is for any position on the pitch, whether you\'re sending a pinpoint pass through the defence or tracking back to stop a break-away.\r\n\r\n\r\nAmplified touch\r\n\r\nThe moulded synthetic leather mimics a quilted sensation for improved touch.\r\n\r\n\r\nNatural, contouring fit\r\n\r\nThe synthetic leather moulds to your foot and gives you better control, helping you stay comfortable for your match.\r\n\r\n\r\nTraction for the pitch\r\n\r\nThe plate places conical studs in the heel for optimal traction and stability when braking and changing direction—just right under any conditions.\r\n\r\n\r\nProduct details\r\n\r\nFor use on natural and synthetic surfaces\r\nCushioned insole\r\nColour Shown: White/Bright Crimson/Black\r\nStyle: DV4344-100\r\nCountry/Region of Origin: Vietnam', '1609000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Women', '2023-12-23 23:51:53', '2023-12-23 23:51:53'),
('8b4e1e6a-084e-4a08-b204-fb3da95540fe', 'Nike Phantom GX Pro', 'Serious about your game? The pro boot is for the pinpoint passer who can curl the ball around the defence and the inventive, yet elusive yo-yo dribbler who has the ball on a string. Your game is all about precision, making the plays that matter most. Take your skills to the next level with some of Nike\'s greatest innovations, like an enlarged touch zone up top. It complements a design that moves with your natural on-pitch flow, so you can command the game from any position.\r\n\r\n\r\nEnhanced Touch\r\n\r\nAn expanded NikeSkin touch zone, powered by engineered mesh, brings your foot even closer to the ball for better control while dribbling and passing in wet or dry conditions. The upper is soft and almost knit-like while the contact zone on the inside of the boot is heightened for even better touch.\r\n\r\n\r\nContoured for Comfort\r\n\r\nAsymmetry in the heel provides comfort. Soft elements in the heel make for an easy break-in process and help reduce irritation and pressure without compromising stability and structure.\r\n\r\n\r\nTraction for the pitch\r\n\r\nTri-star studs work with forefoot flex grooves to provide optimal traction and help unlock change of direction. See the lines on the outsole? They match your typical on-pitch movements, which push forwards then zigzag before a strike.\r\n\r\n\r\nProduct details\r\n\r\nFor use on slightly wet, short-grass pitches\r\nCushioned insole\r\nColour Shown: Hyper Turquoise/Fuchsia Dream/White/Black\r\nStyle: DD9463-300\r\nCountry/Region of Origin: Indonesia', '4109000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Women', '2023-12-23 23:53:40', '2023-12-23 23:53:40'),
('93bd8b13-b062-4b67-bfd4-746bf6132305', 'Nike Superfly 9 Elite Mercurial Dream Speed', 'You\'ve perfected your skill through endless training and channelled your inner fire into your craft. Now, when the weight of the match is squarely on your shoulders, rise to the occasion and deliver. Bold reds and gentle oranges speak to the fearless-yet-grounded attitude needed to embrace these pressure-packed moments. Loaded with a football-specific Zoom Air unit and sticky touch, the Elite boot helps you—and the world\'s biggest stars—take your game to the next level and put the pedal down in the waning minutes of a match, when it matters most.\r\n\r\n\r\nPressure ready\r\n\r\nUndulating, undaunted reds and soothing, rolling oranges represent the passion and adrenaline that arise when the game\'s pressure peaks. Repeating patterns represent the unseen training and endless repetitions that you pour into your game, so that you\'re ready for the pressure. The blend of technical skill and emotional drive combines for a moment of focus and clarity.\r\n\r\n\r\nSpringy underfoot feel\r\n\r\nA 3/4-length Zoom Air unit sits in the plate and provides an extra level of springy underfoot feel that helps you move fast on the pitch and create separation when it matters the most—whether you\'re scoring goals, being first to the ball or going past defenders.\r\n\r\n\r\nImproved fit\r\n\r\nFlyknit wraps your ankle in soft, stretchy fabric for a secure feel. A redone design improves the fit, so that it better simulates the foot. We did this by conducting multiple wear tests on hundreds of athletes. The result is a more contoured toe box and better fit in the heel.\r\n\r\n\r\nFeel the ball\r\n\r\nThe upper is made from Vaporposite+, which combines a grippy, grid mesh with a premium material for optimal ball control at high speeds. The material provides a tactile feel across the surface of the upper. It\'s soft but stable, and wraps tightly around your foot, giving you a more natural on-ball feel when dribbling, passing or scoring.\r\n\r\n\r\nDig in, take off\r\n\r\nTri-star studs provide multi-directional traction with every step, so you can change directions quickly and confidently. Heel studs provide traction and stability when braking. Toe-off centre studs give you traction during explosive starts.\r\n\r\n\r\nDrive your speed\r\n\r\nThe speed cage inside the structure is made from a thin but strong material that secures the foot to the outsole without adding weight.\r\n\r\n\r\nProduct details\r\n\r\nFor use on slightly wet, short-grass pitches\r\nCushioned insole\r\nColour Shown: Light Crimson/Bright Mandarin/Black/Pale Ivory\r\nStyle: FD1157-600\r\nCountry/Region of Origin: China', '8349000', 12, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '4ac0cd63-927a-43a4-a165-1507c1cfc78c', 'Men', '2023-12-23 22:47:36', '2023-12-23 22:47:36'),
('960a800c-673b-4de9-8e73-1c9999a4306f', 'Nike G.T. Hustle 2 GTE EP', 'Your game is as great as ever, but you\'re not the type that basks in past glory. Confident, never content. Skilled, but always pushing to be the absolute best player you can be, day in, day out. This special design celebrates the go-getters who dream about leading the next fast break, ending tomorrow\'s casual game on a win or being Saturday\'s on-the-run game-winner. Loaded with cushion in the core, this shoe helps you stay moving forwards—from check-up to \'that\'s game\'. With its extra-durable rubber outsole, this version gives you traction for outdoor courts.\r\n\r\n\r\nLightweight, smooth, responsive\r\n\r\nThe full-length foam is perfect for providing cushioning at high speed and helps keep your foot from moving around in the shoe. We paired the foam with a moulded insole that makes for a potent combination of soft responsiveness.\r\n\r\n\r\nBouncy and smooth\r\n\r\nWe stitched a full-length Zoom Air unit to the bottom of the upper to give you a propulsive feeling down the floor and optimal energy return from the 1st step you take to the last. Whether you\'re exploding out of triple threat or sprinting from baseline to baseline, it gives you responsiveness directly under your foot.\r\n\r\n\r\nMinimal so you can move\r\n\r\nBuilt like a modern running shoe, the minimal upper helps keep the shoe as lightweight as possible. The mesh uses reinforced layers to create support around the toe, heel and midfoot, delivering stability without adding weight.\r\n\r\n\r\nAnkle support\r\n\r\nPadded, mid-high collar adds support around the ankle without sacrificing agility.\r\n\r\n\r\nMore benefits\r\n\r\nFoam tongue helps reduce lace pressure.\r\nThe Waffle herringbone traction pattern offers great bite and court feel.\r\nColour Shown: Black/Multi-Colour/Picante Red/Black\r\nStyle: FV4139-001\r\nCountry/Region of Origin: China', '5279000', 6, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Men', '2023-12-23 22:44:21', '2023-12-23 22:44:21'),
('977ba539-8386-4197-82fd-623a6cd7b5bb', 'Nike Air Force 1 \'07', 'The radiance lives on in the Nike Air Force 1 \'07, the basketball original that puts a fresh spin on what you know best: durably stitched overlays, clean finishes and the perfect amount of flash to make you shine.\r\n\r\n\r\nBenefits\r\n\r\nThe stitched overlays on the upper add heritage style, durability and support.\r\nOriginally designed for performance hoops, the Nike Air cushioning adds lightweight, all-day comfort.\r\nThe low-cut silhouette adds a clean, streamlined look.\r\nThe padded collar feels soft and comfortable.\r\n\r\nProduct Details\r\n\r\nFoam midsole\r\nPerforations on the toe\r\nRubber sole\r\nColour Shown: White/White\r\nStyle: CW2288-111\r\nCountry/Region of Origin: Vietnam,India\r\n\r\nAir Force 1 Origins\r\n\r\nDebuting in 1982, the AF-1 was the first basketball shoe to house Nike Air, revolutionising the game while rapidly gaining traction around the world. Today, the Air Force 1 stays true to its roots with the same soft and springy cushioning that changed sneaker history.', '2929000', 10, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Men', '2023-12-23 22:15:05', '2023-12-23 22:15:05'),
('98f0590f-3fbe-47e6-8e31-b00445e38925', 'Nike Air Max 90 LTR', 'ICONIC AIR FOR KIDS.\r\n\r\n\r\nThe Nike Air Max 90 LTR returns with an even better feel for you. Cushioning is softer and more flexible, the Max Air unit is tuned for growing feet and the shape gives your toes more wiggle room. With a design and look that are still the same, it brings a \'90s fave to a new generation.\r\n\r\n\r\nUpdated Classic\r\n\r\nThe low-top kicks are made from real and synthetic leather that\'s durable and brings a classic feel. The shape gives toes more wiggle room and the fit helps keep growing feet comfortable.\r\n\r\n\r\nCushioned Comfort\r\n\r\nThe Max Air unit has a softer feel that\'s tuned right for kids. Plus, comfy and flexible foam makes for easy steps.\r\n\r\n\r\nPadded Design\r\n\r\nExtra padding around the ankle gives a plush feel so you can slip right into comfort.\r\n\r\n\r\nNatural Moves\r\n\r\nThe full-length rubber sole features grooves for flexibility so every step feels natural.', '2549000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Kid Girl', '2023-12-24 01:02:42', '2023-12-24 01:02:42'),
('a0bbeaa0-eeec-4fca-9e51-67c301c69721', 'Nike Interact Run', 'Can you see the future? Fast-forward your footsteps in the cutting-edge Nike Interact Run. It\'s set up with all the running goodness you need: a lightweight Flyknit upper, soft foam midsole and comfort where it counts. Scan the QR code on the tongue with your phone, and check out our online introduction to the Nike Interact Run\'s ins and outs.\r\n\r\n\r\nTo the future\r\n\r\nA scannable QR code on the tongue acts as your tour guide to the Interact Run\'s performance benefits. It offers tips on how to extend the life cycle of your shoe from upkeep options to repairs and long-term care. Finally, when you\'ve logged all the miles you can, the QR code will suggest ways to recycle and donate the shoes once they\'ve run their course.\r\n\r\n\r\nMade from Nike Grind\r\n\r\nThe Waffle outsole is made from at least 13% Nike Grind material, crafted from scraps from the footwear-manufacturing process.\r\n\r\n\r\nSoft ride\r\n\r\nThe soft, responsive foam in the midsole gives you a comfortable, smooth ride for your run and wherever else your day takes you. The high foam heights provide a soft feel.\r\n\r\n\r\nFly Away\r\n\r\nThe Flyknit upper has zones of breathability where your foot heats up most, specifically in the toe box. It\'s strong and durable, helping keep your foot secure with every mile. The airy and breezy upper hugs your foot in a free and easy way.\r\n\r\n\r\nMore benefits\r\n\r\nWe created the rubber outsole using runner-informed data for traction where you need it.\r\nThe overlays on the toe offer durability.\r\n\r\nProduct details\r\n\r\nNot intended for use as personal protective equipment (PPE)\r\nColour Shown: Ashen Slate/Football Grey/Star Blue/Black\r\nStyle: FD2291-401\r\nCountry/Region of Origin: Vietnam', '2349000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-23 22:27:45', '2023-12-23 22:27:45'),
('a1e1e1da-8e32-41e9-a9c5-4cfe871567e2', 'Air Jordan 1 Low SE', 'Low-top but never low profile. Inspired by the original that debuted in \'85, this AJ1 offers a clean, classic look that\'s familiar yet always fresh. Pairing full-grain leather overlays with satin underlays gives these Js an extra-smooth look and feel.\r\n\r\n\r\nBenefits\r\n\r\nEncapsulated Nike Air-Sole unit provides lightweight cushioning.\r\nThe outsole enhances traction on various surfaces.\r\nColour Shown: Brown Kelp/Sail/Sky J Light Olive\r\nStyle: FB9893-300\r\nCountry/Region of Origin: Vietnam', '3669000', 6, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Women', '2023-12-24 00:05:57', '2023-12-24 00:05:57'),
('a470e082-652c-4061-b2c6-bf69fef08593', 'Nike Air Force 1 \'07', 'The radiance lives on in the Nike Air Force 1 \'07, the b-ball icon that puts a fresh spin on what you know best: crisp leather, bold colours and the perfect amount of flash to make you shine.\r\n\r\n\r\nBenefits\r\n\r\nThe stitched leather overlays on the upper add heritage style, durability and support.\r\nOriginally designed for hoops, Nike Air cushioning adds lightweight, all-day comfort.\r\nThe low-cut silhouette adds a clean, streamlined look.\r\nThe padded collar feels soft and comfortable.\r\n\r\nProduct Details\r\n\r\nFoam midsole\r\nPerforations on the toe\r\nColour Shown: White/Rugged Orange\r\nStyle: DD8959-115\r\nCountry/Region of Origin: Vietnam\r\n\r\nAir Force 1 Origins\r\n\r\nDebuting in 1982, the AF-1 was the first basketball shoe to house Nike Air, revolutionising the game while rapidly gaining traction around the world. Today, the Air Force 1 stays true to its roots with the same soft and springy cushioning that changed sneaker history.', '2929000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Women', '2023-12-23 23:27:31', '2023-12-23 23:27:31'),
('a6f8665a-e536-4b40-997f-c55e67316939', 'Nike Metcon 9 AMP', 'Whatever your \"why\" is for working out, the Metcon 9 makes it all worth it. We improved on the 8 with a larger Hyperlift plate and added rubber rope wrap. Intended for lifters, trainers and go-getters, some of the greatest athletes in the world swear by it, and it\'s still the gold standard that delivers day after day.\r\n\r\n\r\nTougher and stronger\r\n\r\nWe made the Hyperlift plate in the heel even bigger for stability when tackling tough workouts like Split Squats, Dead Lifts and other lower-body exercises. The plate helps force weight down and out while adding rigidity in the heel. That firmness helps you feel grounded and supported, specifically under heavier loads.\r\n\r\n\r\nSecure feel\r\n\r\nThe lace-lock system attaches to the shoe tongue, so you don\'t have to worry about latching it to any fabric. It helps keep your laces in place, so once you tie up, you can focus solely on your workout.\r\n\r\n\r\nGo to the top\r\n\r\nWe extended the rubber wrap on the side for durability and support so that you can scale any kind of rope climb with the same repeated velocity without worrying about wear and tear. It stretches from the midsole to the upper and adds some support in the upper for multi-directional movements.\r\n\r\n\r\nDurable and cool\r\n\r\nThe lightweight, breathable mesh helps keep your foot cool yet sports the kind of durability that can withstand scrapes, slashes and quick-drag movements.\r\n\r\n\r\nFeel the foam\r\n\r\nA dual-density midsole—firm foam on the outside, soft foam on the inside—provides responsive cushioning for lasting comfort for continuous cardio and movements.\r\n\r\n\r\nMore benefits\r\n\r\nA full-rubber outsole provides durable traction for dynamic movements like Cleans and Walking Lunges.\r\nBreathable textile has a haptic print, which creates a 3D effect that adds durability and texture, helping make it easier to keep your shoes clean. It also provides flexible, durable support in the toe area so, when your toes splay when lifting heavy weights, it won\'t feel restrictive.\r\nColour Shown: Atomic Orange/Ice Peach/Peach Cream/White\r\nStyle: DZ2616-800\r\nCountry/Region of Origin: Vietnam', '4109000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '6707e838-ee4f-4baf-8e09-1aba1af255ae', 'Men', '2023-12-23 22:53:44', '2023-12-23 22:53:44'),
('afdf8ec1-d6db-43f8-a869-e6df8f7a2c55', 'Nike Air Force 1 SE', 'Powered by flowers, these special-edition sneakers are all about stopping to appreciate the little things that put a smile on your face. With smooth leather, tough stitching, comfy Air cushioning and durable tread, this play-ready Air Force 1 is certainly worth smiling about. Originally an all-star on the basketball court, this sneaker is now a superstar on the playground. How will you wear it?\r\n\r\n\r\nBenefits\r\n\r\nReal and synthetic leather add heritage style, durability and support—just like the Air Force 1 first released in \'82.\r\nOriginally designed for performance hoops, hidden Air cushioning in the heel helps deliver lasting comfort.\r\nPadded low-cut collar looks sleek and feels great.\r\nRubber outsole adds traction and durability. Fun fact: the circular tread pattern originally helped basketball players pivot on the court.\r\n\r\nProduct details\r\n\r\nClassic laces\r\nPerforations on the toe\r\nColour Shown: Sand Drift/Twine/Black/White\r\nStyle: FZ1615-100\r\nCountry/Region of Origin: Indonesia\r\n\r\nAir Force 1\r\n\r\nDebuting in 1982 as a basketball must-have, the Air Force 1 came into its own in the \'90s. The clean look of the classic white-on-white AF-1 was endorsed from the basketball courts to the street and beyond. Finding its rhythm in hip-hop culture, releasing limited collabs and colourways, Air Force 1 became an iconic sneaker around the globe. And with over 2,000 iterations of this staple, its impact on fashion, music and sneaker culture can\'t be denied.', '2549000', 6, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Kid Boy', '2023-12-24 00:28:43', '2023-12-24 00:28:43'),
('b0bd1595-9414-4e78-9baa-e7acf25521c8', 'Sabrina 1 \'West Coast Roots\' EP', 'Sabrina Ionescu\'s game is unique, hard to define and built with an undeniable craft. Her signature shoe helps you unlock your versatility with a snappy forefoot Zoom Air unit and cloud-like React foam to help keep you energised. We used insights from next-gen athletes of all genders around the world to bring grippy, best-in-class traction, reliable midfoot support and stability to the court—which every hooper needs. Built for crafty players like Sabrina, but made for anyone who\'s ready to put in the work to take their game to the next level. With its extra-durable rubber outsole, this version gives you traction for outdoor courts.\r\n\r\n\r\nBehind the design\r\n\r\nWhile she\'s ascending to superstardom 3,000 miles away, Sabrina never forgets her roots. This special design takes inspiration from the scenic West Coast sunsets she grew up watching after long days of grinding in the gym.\r\n\r\n\r\nCut quickly\r\n\r\nAthletes like Sabrina informed us on how to build the traction pattern on the outsole. The result? It helps you feel quick in and out of cuts. Feel the hardwood under your feet as you change direction in an instant.\r\n\r\n\r\nStay fresh\r\n\r\nWe\'ve paired a top-loaded forefoot Zoom Air unit with a full-length React foam core to deliver the ideal balance of stability, ground control and cushioning. The unstoppable combination meets at the intersection of speed and endurance, allowing you to play fast and dictate tempo without feeling depleted as the game rages on.\r\n\r\n\r\nPlay with confidence\r\n\r\nWe teamed the collar with a midfoot band system that allows conformability and adjustability around the arch of your foot, all in the name of unlocking quick play and inspiring confidence on the court.\r\n\r\n\r\nSecurity up top\r\n\r\nThe collar offers optimal support with minimalism, giving you the support you need, without any unnecessary weight.\r\n\r\n\r\nPersonal touch\r\n\r\nWhenever Sabrina gives her autograph, she signs her name with a dot above her signature, true to her Romanian pronunciation. This detail, wrapped around her shoe, pays homage to the Ionescu family and the communities that helped push her to make playing pro basketball possible.', '3519000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Women', '2023-12-23 23:45:46', '2023-12-23 23:45:46'),
('b560dbfa-fe0d-4caa-adbe-5d61253a01d4', 'Chuck Taylor All Star Construct Vintage Athletic', 'GLORY DAYS\r\n\r\nStep into the future while your \'fit nods to the past. These vintage varsity high tops bring just the right amount of retro with bold colors and a classic Chuck Taylor patch. Modern comforts include OrthoLite cushioning and a lightweight midsole, so you can navigate the now with ease.\r\n\r\nFeatures And Benefits\r\nHigh top shoe with a canvas upper\r\nVintage color pops on the heel, Chuck patch, and outsole\r\nOrthoLite cushioning for consistent comfort\r\nRubber outsole tread and striping detail for durability\r\n\r\nThere may be a 1-2cm difference in measurements depending on the development and manufacturing process.\r\nColor Disclaimer:\r\n\r\nActual colors may vary. This is due to the fact that every computer monitor has a different capability to display colors, we cannot guarantee that the color you see accurately portrays the true color of the product.', '2500000', 3, 'image.jpg', '0149a509-9bb8-4524-8b0f-84c48d27ed7f', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Men', '2023-12-24 00:43:42', '2023-12-24 00:43:42'),
('b60b6594-f7c4-48e2-b6d9-46da1c8cead2', 'Jordan Stadium 90', 'Comfort is king, but that doesn\'t mean you have to sacrifice style. Taking design inspiration from the AJ1 and AJ5, the Stadium 90 is ready for everyday wear. The upper is made from synthetic leather and textiles, sporting a combination of the AJ1 toe box and flame details from the AJ5. Nike Air cushioning makes every step as effortless as your style.\r\n\r\n\r\nBenefits\r\n\r\nDurable upper is made from real leather, synthetic leather and textile materials.\r\nNike Air technology absorbs impact for cushioning with every step.\r\nRubber outsole provides everyday traction.\r\n\r\nProduct details\r\n\r\nRubber outsole pays homage to the AJ1\r\nFlame details and heel branding reference the AJ5\r\nColour Shown: White/Cool Grey/Black\r\nStyle: HF5258-102\r\nCountry/Region of Origin: China', '4109000', 10, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-23 22:18:48', '2023-12-23 22:18:48'),
('b6925044-b883-49b1-96f8-4f16001a681e', 'Nike SuperRep 4 NN Premium', 'The quad-burning box jumps that bring your \"why\" into focus. The sweat-soaked super-sets that leave you bent over double. This is what you live for: the struggle, the moment of truth, the breakthrough, the transformation. Designed for quick bursts of force, heart-thumping tempo changes and fast-paced workouts, this shoe helps push you to fresh HIIT heights. To top it off, we gave this look a multi-colour glow with Gold accents that\'s sure to help your gains steal the spotlight.\r\n\r\n\r\nMade from Nike Grind\r\n\r\nThe outsole has at least 13% Nike Grind material, made from scraps from the footwear manufacturing process.﻿\r\n\r\n\r\nBounce Right Back\r\n\r\nEvery time you land on your forefoot, 2 powerful Zoom Air units absorb your energy and send it right back—launching you into your next step or jump. A full-length plate distributes the energy, helping balance your foot.\r\n\r\n\r\nSide-to-Side Support\r\n\r\nThe large arc on the side acts as a brace for your foot when you\'re cutting hard from side to side. The mesh ribbing up top—stitched in with a more secure feel on this version—helps keep your foot snug during moves like lateral bounds and side lunges.\r\n\r\n\r\nLightweight, Multi-Directional Support\r\n\r\nThe sleek, integrated mesh creates zones of lightweight support and breathability just where you need it most. The frame and mesh combine to create more forefoot volume to keep it comfortable for a wide range of foot types.\r\n\r\n\r\nEase of Entry\r\n\r\nAn improved fit includes a fully adjustable tongue that lets you step in, cinch down and pour everything you\'ve got into your workout. The tongue combined with the comfort collar makes for easy on and off.\r\n\r\n\r\nMore benefits\r\n\r\nOpen mesh lining helps air flow to help keep your foot cool.\r\nSplit sole promotes more forefoot flexibility for movements like burpees and planks.\r\nColour Shown: Black/Pewter/Metallic Gold\r\nStyle: FB7154-001\r\nCountry/Region of Origin: Vietnam', '4109000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '6707e838-ee4f-4baf-8e09-1aba1af255ae', 'Women', '2023-12-23 23:55:05', '2023-12-23 23:55:05'),
('b8706de8-8175-4a76-9a02-798ea3869930', 'Nike Air Max 1', 'Meet the leader of the pack. Walking on clouds above the noise, the Air Max 1 blends timeless design with cushioned comfort. Sporting a fast-paced look, wavy mudguard and Nike Air, this classic icon hit the scene in \'87 and continues to be the soul of the franchise today.\r\n\r\n\r\nBenefits\r\n\r\nPlush and comfortable, the Max Air cushioning has just the right amount of support.\r\nThe Waffle outsole with flex grooves provides traction that\'s flexible and durable.\r\nColour Shown: White/Deep Royal Blue/Pure Platinum/Black\r\nStyle: FD9082-100\r\nCountry/Region of Origin: China\r\n\r\nAir Max 1\r\n\r\nSure, Air Max 1 started as a running shoe, but you can\'t keep innovation contained. Adopted by hip-hop culture, this runner with a controversial exposed Air unit could be found anywhere from the heart of Brooklyn to the streets of London. Its cutting-edge design and striking colourways, to this day, are celebrated year after year.', '4109000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Men', '2023-12-23 22:59:20', '2023-12-23 22:59:20'),
('bbb759c8-3a59-4bf9-9184-692c0459d31e', 'Air Jordan 1 Zoom CMFT 2', 'Premium suede and Jordan Brand\'s signature Formula 23 foam come together to give you an extra luxurious (and extra cosy) AJ1. You don\'t need to play \"either or\" when it comes to choosing style or comfort with this one—which is nice, \'cause you deserve both.\r\n\r\n\r\nBenefits\r\n\r\nNike Air technology absorbs impact for cushioning with every step.\r\nSuede on the upper and toe breaks in easily and contours to your feet.\r\nJordan Formula 23 foam keeps your feet extra padded.\r\nColour Shown: Sail/Royal Pulse/Light Silver/Alpha Orange\r\nStyle: DV1307-184\r\nCountry/Region of Origin: Indonesia', '4259000', 6, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Men', '2023-12-23 23:05:33', '2023-12-23 23:05:33'),
('c18c5ec0-a343-4ca9-99d5-25ef0c4af291', 'Air Jordan 1 Low', 'Inspired by the original that debuted in 1985, the Air Jordan 1 Low offers a clean, classic look that\'s familiar yet always fresh. With an iconic design that pairs perfectly with any \'fit, these kicks ensure you\'ll always be on point.\r\n\r\n\r\nBenefits\r\n\r\n- Encapsulated Air-Sole unit provides lightweight cushioning.\r\n- Genuine leather in the upper offers durability and a premium look.\r\n- Solid rubber outsole enhances traction on a variety of surfaces.\r\n- Colour Shown: White/Black/White/Royal Blue\r\n- Style: 553558-140\r\n- Country/Region of Origin: Vietnam\r\n\r\nTried and True\r\nA timeless rubber cupsole teams up with a plush sockliner and encapsulated Nike Air cushioning for all-day comfort. A rubber outsole supplies durable traction on a variety of surfaces.', '3239000', 10, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-23 22:11:46', '2023-12-23 22:11:46'),
('c4fe21ca-e75e-478c-8d75-716159cffff9', 'Jordan Nu Retro 1 Low', 'Pulled out of the vault, these low tops are back. Inspired by the original Wings logo and design of the AJ1, these all-day, everyday shoes are ready for whatever. Smooth leather uppers and a big embossed logo will help you stand out, however you style \'em.\r\n\r\n\r\nBenefits\r\n\r\nNike Air technology absorbs impact for cushioning with every step.\r\nLow-cut, cushioned collar fits comfortably around your ankle.\r\nRubber sole gives you ample traction.\r\nColour Shown: Medium Olive/Light Bone/Anthracite/Black\r\nStyle: FB4412-200\r\nCountry/Region of Origin: Vietnam', '2299000', 6, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Kid Boy', '2023-12-24 00:24:53', '2023-12-24 00:24:53'),
('c908b6bb-1ce1-47d4-849b-b5302762e533', 'Run Star Motion CX Platform', 'Reflecting the energy of city streets, the Run Star Motion\'s playful and distorted lines are built for future movement. Reimagined from the inside out, the elevated stance and CX foam midsole help bring next-level comfort to every stride. The upper stays true to the original, juxtaposed by future-forward design details for bold self-expression. An exaggerated, wavy platform and sculptural traction lugs raise you up and help keep you steady with standout traction.\r\n\r\nFeatures And Benefits\r\nHigh-top sneaker with 16oz cotton canvas upper\r\nMesh lining for breathability\r\nSuede leather overlays for texture and style\r\nA mono black design pairs easily with anything and everything\r\nLugged rubber outsole with chevron-inspired tread for enhanced traction\r\n\r\nSize Disclaimer: There may be a 1-2cm difference in measurements depending on the development and manufacturing process.\r\n\r\nColor Disclaimer: Actual colors may vary. This is due to the fact that every computer monitor has a different capability to display colors, we cannot guarantee that the color you see accurately portrays the true color of the product.', '2600000', 6, 'image.jpg', '0149a509-9bb8-4524-8b0f-84c48d27ed7f', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-24 00:41:05', '2023-12-24 00:41:05'),
('c99bbea7-aeee-4e57-9b77-e85ce35890d4', 'Nike InfinityRN 4 GORE-TEX', 'With supportive cushioning built for a smooth run, the Nike InfinityRN 4 is a brand-new take on a familiar favourite. It\'s made from our all-new Nike ReactX foam, which gives you 13% more energy return compared to Nike React foam, to help you stay fresh and bouncy. (What\'s more? Nike ReactX reduces its carbon footprint in a pair of midsoles by at least 43% compared with Nike React foam.*) This version has GORE-TEX fabric to help you stay dry for your miles. It\'s the kind of shoe that supports every step in style. *The carbon footprint of ReactX is based on a cradle-to-gate assessment reviewed by PRé Sustainability B.V. and Intertek China. Other midsole components such as airbags, plates or other foam formulations were not considered.\r\n\r\n\r\nWhat\'s new about the Nike InfinityRN 4?\r\n\r\nThis version of the Nike InfinityRN 4 still provides a plush and smooth ride, with ReactX foam delivering more support. The wider toe box helps your foot feel stable and secure.\r\n\r\n\r\nDry Design\r\n\r\nWaterproof GORE-TEX fabric helps keep you dry so you can focus on the adventure.\r\n\r\n\r\nCushioning: super-high\r\n\r\nThe more cushioning you have underfoot, the softer and more comfortable your running experience can be. Cushioning helps soften the impact as your feet hit the ground. ReactX foam gives you an incredibly smooth feeling, helping you push your limits.\r\n\r\n\r\nSupport: high\r\n\r\nThe more supportive the shoe, the more stability it can give to your natural stride. A combination of tuned support and intentionally placed cushioning helps you feel secure with every step. A curved outsole helps your foot rock smoothly from heel to toe and through your stride to footstrike. It makes every step feel more natural and adds efficiency to your run, helping you waste less energy as you hit your stride.\r\n\r\n\r\nResponsiveness: moderate\r\n\r\nThe more responsive the shoe, the more energy return you can get back with each step. Whether you want to run a little bit faster or with a little less effort, responsive shoes help give you slightly more spring in your step to get more out of your run. ReactX foam gives you +13% energy return compared with React foam, helping you stay fresh and bouncy during your run.\r\n\r\n\r\nReliable Traction\r\n\r\nA Storm Tread outsole provides reliable traction on wet and slippery surfaces. The rubber wraps around the front of the shoe for extra durability. Its generative traction pattern combined with rubber lugs gives you grip when going uphill or downhill.\r\n\r\n\r\nMore benefits\r\n\r\nA water-repellent liner in the toe helps keep you dry when the weather turns.\r\nFoam collar is soft and supportive to the touch.\r\nIncreased rubber on the outsole gives traction and durability.\r\n\r\nProduct details\r\n\r\nNot intended for use as personal protective equipment (PPE)\r\nColour Shown: Pale Ivory/Summit White/Platinum Tint/Anthracite\r\nStyle: FB2197-100\r\nCountry/Region of Origin: Vietnam', '5279000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Men', '2023-12-23 23:42:36', '2023-12-23 23:42:36'),
('cc770d0f-66f9-45f5-b79e-6f3c2dd46328', 'Nike Quest 5', 'A LIGHTWEIGHT, NEUTRAL RIDE.\r\n\r\n\r\nYou lace up in pursuit of new personal goals. Let the Nike Quest 5 help you reach those aspirations. This neutral sneaker gives you a smooth, comfortable ride with plenty of traction. We focused on our foam, adding more cushioning for a better transition from heel to toe.\r\n\r\n\r\nCool, Light, Fast\r\n\r\nWe used runner-informed data to create engineered mesh for a lightweight and breathable feel. The mesh was placed in key zones based on runner feedback, providing you with cooling where it counts.\r\n\r\n\r\nLace Up, Support Up\r\n\r\nFeel the stability with the midfoot fitband. It works with your laces, keeping your foot more secure the tighter your laces are. A translucent material shows off the components at the midfoot.\r\n\r\n\r\nRun Hard with a Soft Feel\r\n\r\nSuper-soft foam through the midsole helps cushion your foot with every step. The increased height means a softer sensation as you run.\r\n\r\n\r\nTraction for the Long Haul\r\n\r\nThe rubber outsole has the traction to keep your feet gripped to the pavement.\r\n\r\n\r\nMore Benefits\r\n\r\nSuper-soft padding and cushioning on the collar help keep your ankle comfortable.\r\nSkins at the toes and eyelets offer durability.\r\nColour Shown: White/Pure Platinum/Metallic Silver\r\nStyle: DD9291-100\r\nCountry/Region of Origin: Vietnam', '1860000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Women', '2023-12-23 23:39:46', '2023-12-23 23:39:46'),
('d36f582b-f30a-4c52-a4bf-14e441fe4689', 'Nike Air Force 1 \'07 NN', 'This hoops original gives \"fresh air\" a whole new meaning. Breezy canvas, a bouquet of spring colours and embroidered details bring summertime vibes to what you already know and love: Air cushioning, classic construction and style for days.\r\n\r\n\r\nBenefits\r\n\r\nFrom the tough stitching to the sturdy cupsole, durability is the name of the game.\r\nOriginally designed for performance hoops, Air cushioning delivers lasting comfort, while a padded ankle and tongue add softness to the ride.\r\nRubber outsole with heritage hoops pivot circles adds traction where you need it.\r\nLow-cut, padded collar looks sleek and feels great.\r\nColour Shown: Platinum Violet/Coconut Milk/Volt/Sail\r\nStyle: DV3808-001\r\nCountry/Region of Origin: Indonesia\r\n\r\nAir Force 1\r\n\r\nDebuting in 1982 as a basketball must-have, the Air Force 1 came into its own in the \'90s. The clean look of the classic white-on-white AF-1 was endorsed from the basketball courts to the street and beyond. Finding its rhythm in hip-hop culture, releasing limited collabs and colourways, Air Force 1 became an iconic sneaker around the globe. And with over 2,000 iterations of this staple, its impact on fashion, music and sneaker culture can\'t be denied.', '3239000', 6, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Women', '2023-12-23 23:34:29', '2023-12-23 23:34:29'),
('d74a3274-c1e7-440f-9c23-de6f1a9654ea', 'Nike Victory Pro 3', 'Made for your triumphant marches down the fairway after striping that drive and surprisingly fresh legs when it\'s time to take off the hats, these shoes have an updated design that maintains those true old-school stylings with even more pop, comfort and traction. It\'s perfect for a post-work bucket of balls or the foot-wedger hoping to blend in with the group while getting a little closer to the hole.\r\n\r\n\r\nBenefits\r\n\r\nThe removable spikes twist and lock into the outsole for enhanced grip and ground feel on various surfaces.\r\nThe hybrid outsole provides durable traction for inclement weather.\r\nSynthetic leather feels soft to the touch and adds a sophisticated look.\r\nThe lightweight tongue provides comfort on the top of your foot.\r\n\r\nProduct details\r\n\r\nOne-year waterproof warranty\r\nTraditional lace-up closure\r\nFoam midsole\r\nColour Shown: Black/Smoke Grey/White\r\nStyle: DX9028-010\r\nCountry/Region of Origin: Vietnam', '3519000', 2, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'f481b673-2193-4b97-a1ff-d74a6821ad07', 'Men', '2023-12-23 23:13:09', '2023-12-23 23:13:09'),
('db2d5290-13c3-4b47-b608-fb71d2a9741a', 'Air Jordan 1 Low G NRG', 'One of the reasons why MJ loves golf so much: it\'s like looking into a mirror. The only opponent he sees is staring right back at him. No teammates to play off. No defender to go at. Just him, his swing and the course. This special AJ1 Low, with its metallic finishes, chrome aglets and glossy Air Jordan details, takes inspiration from the internal drive that inspires both MJ and us to keep getting better every day.\r\n\r\n\r\nOriginal AJ1 design\r\n\r\nFrom encapsulated Air cushioning to the embossed Wings logo on the strap, everything you love about the AJ1 returns.\r\n\r\n\r\nClassic, Clean Profile\r\n\r\nThe classic cupsole construction provides durability, traction and support while maintaining the shoe\'s iconic profile, with high sidewalls and overt stitching.\r\n\r\n\r\nMore benefits\r\n\r\nLeather provides durability and adds a premium look.\r\nColour Shown: Metallic Silver/Photon Dust/White/Metallic Silver\r\nStyle: FD6848-001\r\nCountry/Region of Origin: China', '4699000', 8, 'image.jpg', '32e3c6fc-88a9-4f6d-b1e8-efe4f403bb07', 'f481b673-2193-4b97-a1ff-d74a6821ad07', 'Men', '2023-12-23 23:11:29', '2023-12-23 23:11:29'),
('dfe6d78b-b5dc-4d93-8b5a-cd581ee44935', 'Chuck 70', 'Converse CHUCK 70 HI Men\'s Sneakers Shoes - Sunflower Find the perfect style for you', '2000000', 7, 'image.jpg', '0149a509-9bb8-4524-8b0f-84c48d27ed7f', '43bb4b5f-4978-4330-9f27-ebae79a907a0', 'Men', '2023-12-24 00:42:42', '2023-12-24 00:42:42'),
('e056797c-4b7c-4d15-9392-403b93417397', 'Nike Air Max 1 \'86 OG G', 'A streetwear legend hits the links in the Air Max 1 G. Featuring the 4-window design that lets you peak at the large Air unit underneath, this is on-course cool, confidence and comfort personified. It sports the vintage Air Max 1 details you love, like clean lines and unmistakable colours, and melds them with our game-changing golf technology, so you can play all day, all year round in a timeless fit.\r\n\r\n\r\nVisible Max Air\r\n\r\nThe 4-window design allows you a grand view of the optimal cushioning with every step. The design details are inspired by the ageless look of the Air Max 1 that was released in 1986, included the debossed \"Nike Air\" logo on the heel.\r\n\r\n\r\nStay Dry\r\n\r\nThe synthetic upper provides water resistance in all-weather conditions.\r\n\r\n\r\nTraction for the Course\r\n\r\nUpdated traction pattern gives you grip on the course in various conditions.\r\n\r\n\r\nProduct Details\r\n\r\nOne-year waterproof warranty\r\nIncreased durability for long-lasting wear\r\nSpikeless\r\nFull-length foam midsole\r\nColour Shown: Sea Glass/Mica Green/Lime Blast/Sequoia\r\nStyle: DV1403-002\r\nCountry/Region of Origin: Vietnam', '3747000', 3, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'f481b673-2193-4b97-a1ff-d74a6821ad07', 'Men', '2023-12-23 23:07:42', '2023-12-23 23:07:42'),
('e2942323-4f59-49af-976e-c18a9da12df3', 'Cosmic Unity 3', 'Better for your game, designed with sustainability in mind—two things you care about—the Cosmic Unity 3 has a secure, lightweight design for a low-to-the-ground feel. It gives you cloud-like cushioning for explosive speed and quick changes of direction, the difference-makers in a game that\'s becoming more extraterrestrial.\r\n\r\n\r\nContained Cushioning\r\n\r\nWe inserted foam into the midsole for a balance of cloud-like cushioning and stability to play at all speeds, all while getting lower to the ground to help increase quickness.\r\n\r\n\r\nSecure and Confident Fit\r\n\r\nThe midfoot Flymesh hugs the midfoot to help keep you contained. A newly implemented Flyknit collar offers plush support to help build confidence, all while helping reduce the weight of the shoe to increase lightweight agility. The Flyknit gives you a flexible, comfortable material that moves and contorts to your foot to complement the Flymesh.\r\n\r\n\r\nStick and Move\r\n\r\nA thin, durable outsole uses rubber to help provide the on-court traction you need to help you move off the ball and find the room needed to shake off the defence.', '4409000', 7, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Women', '2023-12-23 23:44:15', '2023-12-23 23:44:15'),
('e8259de1-ed8f-47aa-b94e-e223ebeda146', 'Run Star Motion Foundational', 'Forget what you knew about form. The Run Star Motion takes classic Converse DNA and pairs it with an ultra-modern, innovative midsole to completely redefine platform style. The fluid lines you saw on court in the early 2000s come through the platform midsole, blending sport with high fashion. This expressive, lugged base is fused with an organic cotton canvas upper that borrows the same stitching, laces, and vintage inner tongue logo as the iconic Chuck 70. All supported by a CX sockliner and CX foam midsole for lightweight, maximum comfort.\r\n\r\nFeatures And Benefits\r\nLow-top, platform shoe with expressive lugged outsole and premium Chuck 70 detailing\r\n100% organic cotton canvas upper\r\nHeel pods with ultra-expressive lugs define the style\r\nClassic Chuck 70 upper, including stitching, laces, eyelets, and vintage inner tongue logo\r\nCX foam midsole with sculpted, debossed pinstripe; CX sockliner for comfort\r\n\r\nSize Disclaimer: There may be a 1-2cm difference in measurements depending on the development and manufacturing process.\r\n\r\nColor Disclaimer: Actual colors may vary. This is due to the fact that every computer monitor has a different capability to display colors, we cannot guarantee that the color you see accurately portrays the true color of the product.', '2600000', 2, 'image.jpg', '0149a509-9bb8-4524-8b0f-84c48d27ed7f', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Women', '2023-12-24 00:47:04', '2023-12-24 00:47:04'),
('eb23c9df-b848-4f01-ab5a-555a3dd83ece', 'Air Jordan Legacy 312 Low', 'Celebrate MJ\'s legacy with this shout-out to Chicago\'s 312 area code. With elements from three iconic Jordans (the AJ3, AJ1 and Air Alpha Force), it\'s a modern mash-up that reps the best.\r\n\r\n\r\nBenefits\r\n\r\nDesign combines iconic elements of the AJ3, AJ1 and Alpha Force.\r\nThe midfoot strap adds bold branding and secures your fit.\r\nVisible Air-Sole unit at the heel enhances cushioning.\r\nColour Shown: White/Black/Sail/Wolf Grey\r\nStyle: CD7069-110\r\nCountry/Region of Origin: Indonesia', '4259000', 11, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', 'e0c300ca-9c34-4172-bb96-a2ef9c96692f', 'Men', '2023-12-23 22:29:39', '2023-12-23 22:29:39');
INSERT INTO `products` (`product_id`, `product_name`, `desciption`, `default_price`, `default_stock_quantity`, `image`, `brand_id`, `category_id`, `gender`, `created_at`, `updated_at`) VALUES
('ecaee277-9218-43cc-9314-dc9a6a19b404', 'Nike Interact Run X', 'Can you see the future? Fast-forward your footsteps in the cutting-edge Nike Interact Run. It\'s set up with all the running goodness you need: a lightweight Flyknit upper, soft foam midsole and comfort where it counts. Scan the QR code on the tongue with your phone, and check out our online introduction to the Nike Interact Run\'s ins and outs.\r\n\r\n\r\nTo the future\r\n\r\nA scannable QR code on the tongue acts as your tour guide to the Interact Run\'s performance benefits. It offers tips on how to extend the life cycle of your shoe from upkeep options to repairs and long-term care. Finally, when you\'ve logged all the miles you can, the QR code will suggest ways to recycle and donate the shoes once they\'ve run their course.\r\n\r\n\r\nMade from Nike Grind\r\n\r\nThe Waffle outsole is made from at least 13% Nike Grind material, crafted from scraps from the footwear-manufacturing process.\r\n\r\n\r\nSoft ride\r\n\r\nThe soft, responsive foam in the midsole gives you a comfortable, smooth ride for your run and wherever else your day takes you. The high foam heights provide a soft feel.\r\n\r\n\r\nFly away\r\n\r\nThe Flyknit upper has zones of breathability where your foot heats up most, specifically in the toe box. It\'s strong and durable, helping keep your foot secure with every mile. The airy and breezy upper hugs your foot in a free and easy way.\r\n\r\n\r\nMore benefits\r\n\r\nWe created the rubber outsole using runner-informed data for traction where you need it.\r\nThe overlays on the toe offer durability.\r\nColour Shown: Platinum Violet/Smokey Mauve\r\nStyle: FD2292-007\r\nCountry/Region of Origin: Vietnam', '2349000', 6, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '90d68216-2cd9-4e00-b592-95bcdc69f7de', 'Women', '2023-12-23 23:37:52', '2023-12-23 23:37:52'),
('f23a363c-67d6-41ae-8839-f2c573088759', 'Nike MC Trainer 2', 'The Nike MC Trainer 2 can help you shift from circuit training in the weight room to the Astroturf for quick-twitch conditioning, seamlessly. It\'s a multi-purpose power that combines versatility, stability and longevity so that you can stay locked in on the physical task at hand. From back squats to sprint repeats, it can help support the rigours of your diverse training programme without having to make a pit stop to grab more gear for your workout.\r\n\r\n\r\nStable Strength\r\n\r\nThe flat base is wider around the heel to help stabilise your foot while you work with weights. Overlays around the toe and laces add durability to stand up to the rigours of the gym.\r\n\r\n\r\nMove It from Side to Side\r\n\r\nSupport wraps from the heel up to the sides for a snug fit when you tighten the laces. Soft foam provides supportive cushioning and rises at the sides to help brace your foot during lateral moves.\r\n\r\n\r\nThick and Thin Traction\r\n\r\nRubber tread gives you traction from the turf to the training room floor. It\'s thicker under the heel for stability while you lift, and thinner in the front for flexibility during short runs or speed drills.\r\n\r\n\r\nProduct details\r\n\r\nMesh up top lets your foot breathe\r\nDirectional rubber traction on the side gives you grip on the ropes\r\nColour Shown: Light Silver/Iron Grey/Bright Mandarin\r\nStyle: DM0823-010\r\nCountry/Region of Origin: Vietnam', '1758000', 5, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '6707e838-ee4f-4baf-8e09-1aba1af255ae', 'Men', '2023-12-23 22:57:10', '2023-12-23 22:57:10'),
('f33b8f5b-c1ef-4bef-97dd-c054777d6071', 'NikeCourt Lite 4', 'Whether you\'re digging, dinking or trying to barrel a ball down the line after scrambling out of a split set, the NikeCourt Lite 4 can help you hold serve. It\'s durable yet mobile when in the middle of a long rally, ideal for getting to seemingly untouchable shots both near and far.\r\n\r\n\r\nDurable Traction\r\n\r\nExtra rubber in the toe area, specifically the big-toe side, adds durability where it\'s needed. Full-coverage high-abrasion rubber along the outsole offers durability and traction.\r\n\r\n\r\nSecure Support\r\n\r\nSynthetic overlays give lateral support and help keep your heel secure.\r\n\r\n\r\nBreathable upper\r\n\r\nMesh in the upper offers breathability and comfort.\r\n\r\n\r\nSoft and easy\r\n\r\nA soft collar and padded heel give you comfort around your ankle.', '2189000', 8, 'image.jpg', '3ef050cf-31e7-48d4-b7f3-c2e60116f035', '3242b7c7-b91c-483f-ae41-49324e83b66e', 'Men', '2023-12-23 23:21:22', '2023-12-23 23:21:22');
